import React, { Component } from "react";

class General extends Component {
	constructor() {
		super();
		this.state = {
			name: "Matthew",
			phone: "131351",
			email: "6516161651651",
		};
	}

	render() {
		return (
			<div>
				<div>
					<p>{this.state.name}</p>
					<p>Phone: {this.state.phone}</p>
					<p>Email: {this.state.email}</p>
				</div>
			</div>
		);
	}
}

export default General;
